from Cryptodome.PublicKey import RSA
from Cryptodome.Util.number import bytes_to_long


class SlaKey:
    vendor = None
    da_codes = None
    name = None
    d = None
    n = None
    e = None

    def __init__(self, vendor, da_codes, name, d, n, e):
        self.vendor = vendor
        self.da_codes = da_codes
        self.name = name
        self.d = d
        self.n = n
        self.e = e
        if isinstance(d, int):
            d_da = d
        else:
            d_da = bytes_to_long(bytes.fromhex(self.d))
            # print(d_da)
            # print()
        if isinstance(n, int):
            n_da = n
        else:
            n_da = bytes_to_long(bytes.fromhex(self.n))
            # print(n_da)
            # print()
        if isinstance(e, int):
            e_da = e
        else:
            e_da = bytes_to_long(bytes.fromhex(self.e))
        self.key = RSA.construct((n_da, d_da, e_da))


